import { StyleSheet, Text, View } from 'react-native'

export default function App() {
  const [path, setPath] = useState<string|null>(null)

  return (
    <View style={styles.container}>
      {path == undefined &&
        <View>
          <Text>Simplify</Text>  
        </View>
      }

    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
})
